problem:
For how many positive integral values of $a$ is it true that $x = 2$ is the only positive integer solution of the system of inequalities $$
\begin{cases}
2x>3x-3\\
3x-a>-6
\end{cases}
$$

Let  \[ f(x) =
\begin{cases}
-x^2 & \text{if } x \geq 0,\\
x+8& \text{if } x <0.
\end{cases}
\]Compute $f(f(f(f(f(1))))).$

Let \[f(x) =
\begin{cases}
x/2 &\quad \text{if } x \text{ is even}, \\
3x+1 &\quad \text{if } x \text{ is odd}.
\end{cases}
\]What is $f(f(f(f(1))))$?

Let \[f(n) = \left\{
\begin{array}{cl}
n^2-2 & \text{ if }n<0, \\
2n-20 & \text{ if }n \geq 0.
\end{array}
\right.\]What is the positive difference between the two values of $a$ that satisfy the equation $f(-2)+f(2)+f(a)=0$?

For some constants $a$ and $b,$ let \[f(x) = \left\{
\begin{array}{cl}
ax + b & \text{if } x < 2, \\
8 - 3x & \text{if } x \ge 2.
\end{array}
\right.\]The function $f$ has the property that $f(f(x)) = x$ for all $x.$ What is $a + b?$

Let \[f(x) = \left\{
\begin{array}{cl} ax+3, &\text{ if }x>2, \\
x-5 &\text{ if } -2 \le x \le 2, \\
2x-b &\text{ if } x <-2.
\end{array}
\right.\]Find $a+b$ if the piecewise function is continuous (which means that its graph can be drawn without lifting your pencil from the paper).

Let $g(x)$ be a function piecewise defined as \[g(x) = \left\{
\begin{array}{cl}
-x & x\le 0, \\
2x-41 & x>0.
\end{array}
\right.\] If $a$ is negative, find $a$ so that $g(g(g(10.5)))=g(g(g(a)))$.

Let \[f(x) = \left\{
\begin{array}{cl}
x^2+1 &\text{ if }x>5, \\
2x-3 &\text{ if } -5 \le x \le 5, \\
3 &\text{ if } x <-5.
\end{array}
\right.\]Find $f(-7)+f(0)+f(7)$.

If $x=2$ and $y=3$, express the value of the following as a common fraction: $$
\frac
{~\frac{1}{y}~}
{\frac{1}{x}}
$$

Let \[f(x) =
\begin{cases}
9x+16 &\text{if }x<2, \\
2x-14&\text{if }x\ge2.
\end{cases}
\]If $f(x)=-2$, find the sum of all possible values of $x$.

For all complex numbers $z$, let \[f(z) = \left\{
\begin{array}{cl}
z^{2}&\text{ if }z\text{ is not real}, \\
-z^2 &\text{ if }z\text{ is real}.
\end{array}
\right.\]Find $f(f(f(f(1+i))))$.

Let \[f(x) =
\begin{cases}
3x^2 + 2&\text{if } x\le 3, \\
ax - 1 &\text{if } x>3.
\end{cases}
\]Find $a$ if the graph of $y=f(x)$ is continuous (which means the graph can be drawn without lifting your pencil from the paper).

Allie and Betty play a game where they take turns rolling a standard die. If a player rolls $n$, she is awarded $f(n)$ points, where  \[f(n) = \left\{
\begin{array}{cl} 6 & \text{ if }n\text{ is a multiple of 2 and 3}, \\
2 & \text{ if }n\text{ is only a multiple of 2}, \\
0 & \text{ if }n\text{ is not a multiple of 2}.
\end{array}
\right.\]Allie rolls the die four times and gets a 5, 4, 1, and 2. Betty rolls and gets 6, 3, 3, and 2. What is the product of Allie's total points and Betty's total points?
